A Photographic Atlas of Marine Biology 
by Gary D. Wisehart, Erin C. Rempala, Michael J. Leboffe and David Ferguson
Morton Publishing Company | January 2012 | 320 Pages | ISBN: 0895827859 | True PDF | 27.9 mb &lt;a href=&quot;
http://www.amazon.com/A-Photographic-Atlas-Marine-Biology/dp/0895827859&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.amazon.com/A-Photographic-Atlas-Marine-Biology/dp/0895827859&lt;/a&gt;

This book is a full-color supplement that provides photographs of preserved specimens and images taken at various aquaria to provide coverage of organisms in the world's oceans. It is designed to accompany any marine biology text or laboratory manual.
